// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
contract Block4Health{

     uint256 Hospital=0;
    struct Registered_Doctor{
         string Doctor_Hash;
         uint Hospital_id;



    }
    // patient Hospital Record
    struct Hospital_Record{
         address Hospital_id;
         string Hospital_hash_record;
    }

    mapping(uint256=>Hospital_Record) public Hospital_map;
    mapping(uint256=>Registered_Doctor []) public Hospital_Doctor;

  function All_Hospital(uint256 id) public view returns(Registered_Doctor[] memory) {
        return Hospital_Doctor[id];
    }


    // patient Patient personal Records
    struct Patient_Info{
         address PatientID;
         string Hashrecord;
    }
    /// permission Granted Which Person;
    // mapping(Grantedby=>GrantedTo) public Access;
    struct acess{
         bool View; address EHR_ID;
    }
//     mapping(address=>mapping(uint256=>mapping(uint256=>acess))) public Patient_Grant;
    mapping(address=>Patient_Info) public Patient_map;
    // patient EHR Records
     struct EHR_Records{
         string DoctorReport;
    }
//     mapping(address=>mapping(address=>EHR_Records)) public EHR_Store;
//     mapping(address=>EHR_Records) public EHR_Store;
//     mapping(address=> mapping(address=>EHR_Records) ) public EHR_Store_Access;
mapping(address => EHR_Records) public EHR_Store;
mapping(address => address[]) public EHR_Store_Access;

    // Registering patient on BLock4Health

    function Register_patient(string memory HasHrecod) public  {
         require(Patient_map[msg.sender].PatientID!=msg.sender,"you are already register");
         Patient_map[msg.sender]= Patient_Info(msg.sender,HasHrecod);
    }

    function Retrieve_patient() external view returns(Patient_Info memory)  {
        require(Patient_map[msg.sender].PatientID==msg.sender,"Pls Register yourself");
         return Patient_map[msg.sender];

    }
    //modifier
    /***/
     modifier Hospital_Regst_or_not(uint256 Hospital_id) {
      string memory name1=Hospital_map[Hospital_id].Hospital_hash_record;
          uint256 bytelength = bytes(name1).length;
        require(bytelength!=0,"Your Hospital is not Register");
    _;
     }
     modifier on_agin_Register {
        for(uint256 i=0;i<=Hospital;i++){
         require(Hospital_map[i].Hospital_id!=msg.sender,"Your Hospital is already Register");
        }
    _;
     }

     /***/
    // Registering Hospital  on BLock4Health
    function Register_Hospital(string memory Hash_record)  public on_agin_Register returns(uint) {
        Hospital_map[Hospital++]= Hospital_Record(msg.sender,Hash_record);
          return Hospital-1;
    }

    function Insert_Doctor_Hospital(uint Hospital_id,string memory Doctor_Hash)  public Hospital_Regst_or_not(Hospital_id)  {
        Hospital_Doctor[Hospital_id].push(Registered_Doctor(Doctor_Hash,Hospital_id));
    }


     function MakeEHR(string memory EHRpdf,address patient_id) public{
          EHR_Store[patient_id]=EHR_Records(EHRpdf);
     }

     // View EHR of patient
     function ViewEHR(address patient_id) public view  returns(EHR_Records memory ) {
          // require(Patient_map[msg.sender].PatientID==msg.sender,"you are not register");
          return EHR_Store[patient_id];

     }
}
